contract kake {
    
    //initialized to 0 by default
    uint8 public favoriteNumber;

    function store(uint8 _favoriteNumber) public {
        favoriteNumber = -favoriteNumber; 
    } 

    function viewretrieve() public returns(uint256) {
        return favoriteNumber; 
    }
}

